import React from "react";
import { Link } from "react-router-dom";

export const MoviesList = ({ movies, onMovieSelected }) => {
  const link = `/MovieInfo/${m.id}`  
  return (
    <>
      <ul>
        {movies.map((m) => (
          <li key={m.id}><Link to={{link}}>{m.title}</Link></li>
        ))}
      </ul>
    </>
  );
};
